import React from 'react';

function WelcomePage({ user, onLogout }) {
    return (
        <div>
            <h1>Welcome, {user.name}</h1>
            <p>Username: {user.username}</p>
            <p>Role: {user.role}</p>
            <button onClick={onLogout}>Logout</button>
        </div>
    );
}

export default WelcomePage;
